import React from "react";
import { Row, Col, Button } from "antd";
import { useRouter } from "next/router";
import { WidthImg, centerCol, Texty } from "../assets/css/style_result";

const Home = () => {
	const router = useRouter();

	const toTest = () => {
		router.push("/test");
	};

	return (
		<>
			<Row justify="center">
				<Col {...centerCol}>
					<Texty strong top={100} bottom={20} font={20}>
						나랑 어울리는 애완동물은?
					</Texty>
				</Col>
			</Row>

			<Row justify="center">
				<Col {...centerCol}>
					<WidthImg src={require("../assets/images/dog.png")} />
				</Col>
			</Row>

			<Row justify="center">
				<Col xs={18} sm={18} md={18} lg={18} xl={18}>
					<Button
						type="primary"
						style={{
							display: "block",
							marginTop: "20px",
							width: "100%",
							height: "40px",
						}}
						onClick={toTest}
					>
						테스트 시작!
					</Button>
				</Col>
			</Row>

			<Row style={{ height: "200px" }}></Row>
		</>
	);
};

export default Home;
